DELIMITER $$
--
-- Procedures
--
CREATE DEFINER=`root`@`localhost` PROCEDURE `criarTabelaGrupo` (IN `nome` VARCHAR(50), IN `idG` INT)  begin
	DECLARE codSQL varchar(255);
    DECLARE tm INT;
	DECLARE n,tp varchar(20);
	DECLARE fim INT;
	DECLARE cur_At CURSOR FOR (SELECT atributos.Nome, atributos.Tipo,atributos.Tam from possui,atributos 
    where possui.id_Grupo = idG and possui.id_Atributo = atributos.id);	
	
	DECLARE CONTINUE HANDLER FOR NOT FOUND SET fim = 0;
   
	SET fim = 1;
    SET @codSQL = CONCAT("CREATE TABLE ", nome, "( id INT AUTO_INCREMENT PRIMARY KEY, lat FLOAT(8,6) NOT NULL, long FLOAT(8,6)  NOT NULL ");
    
    OPEN cur_At;
	WHILE (fim = 1) DO
		FETCH cur_At INTO n,tp,tm;
		SET @codSQL = CONCAT(codSQL, ", ", n," ", tp, "(", tm, ")");
	END WHILE;
	SET @codSQL = CONCAT(codSQL, ");");
	PREPARE cod FROM @codSQL;
	EXECUTE cod;

end$$

DELIMITER ;

